            <PropertyImageWrapper>
              <img src= "https://images.ctfassets.net/8lc7xdlkm4kt/5XZ6f7kcqu0cVgTnFoFnLt/52ac8951ab8edd991e28b383a6eac830/61M2.jpg" alt="apartamento" />
            </PropertyImageWrapper>
            <PropertyInfoWrapper>
                Info...
            </PropertyInfoWrapper>
        </PropertyTypeCardWrapper>
    );
};
